import React from 'react';
import { Switch, Route } from 'react-router-dom'
import './App.css';

function Main() {
  return (
    <main>
      <Switch>
        <Route exact path='/' component={Home}/>
        <Route path='/roster' component={Roster}/>
        <Route path='/schedule' component={Schedule}/>
      </Switch>
    </main>
  );
}



function App() {
  return (
    <div>
      <Header />
      <Main />
    </div> 
  );
}

export default App;
